import {createTheme} from '@material-ui/core/styles'
import { orange, teal, white } from '@material-ui/core/colors'

const theme = createTheme({
    palette: {
        primary: {
            main: orange[400]
        },
        secondary: {
            main: teal[300], 
            contrastText: white
        }
    }
})

export default theme;
